import React from 'react';
import Project from './Project';

const projects = [
  { 
    id: 1, 
    name: "ES6 Readme Generator", 
    description: "The ES6 Readme Generator is a project that allows developers to quickly and easily generate high-quality README files for their JavaScript projects using ES6 syntax.", 
    links: [ 
      { title: "Deployed Version", url: "https://chrisgriffin2001.github.io/week-somthing-mod-11/" }, 
      { title: "GitHub Repository", url: "https://github.com/chrisgriffin2001/week-somthing-mod-11.git" } 
    ], 
    image: "public/assets/Screenshot 2023-02-17 at 20.01.27.png" 
  }, 
  { 
    id: 2, 
    name: "Team Profile Generator", 
    description: "The Team Profile Generator is a command-line application that takes in information about employees on a software engineering team and generates an HTML webpage that displays summaries for each person.", 
    links: [ 
      { title: "Deployed Version", url: "https://chrisgriffin2001.github.io/scaling-octo-funicular/" }, 
      { title: "GitHub Repository", url: "https://github.com/chrisgriffin2001/scaling-octo-funicular.git" } 
    ], 
    image: "src/assets/Screenshot 2023-02-17 at 20.01.27.png" 
  }, 
  // add more projects here 
];

function App() {
  return (
    <div>
      <Navbar />
      <Header />
      <main>
        <h2 id="projects">Projects</h2>
        {projects.map(project => (
          <Project key={project.id} project={project} />
        ))}
      </main>
    </div>
  );
}

export default App;
